import './style.css';

function App() {
  const [] = useState('Teste 1234');
  return (
    <div className="Principal">
      <h1 className='titulo'>Pesquisar CEP</h1>
<div>
      <input className='entrada'
      placeholder='digite o seu cep'/>
      <button className='pesquisar'>
        Cep
      </button>
      </div>
      <main className='main'>
        <h2>CEP: xxxx-xxxxx</h2>
        <spa>rua</spa>
        <spa>complemento</spa>
        <spa>vila</spa>
        <spa>campo</spa>
      </main>
    </div>
  );
}

export default App;
